var gridSize = 11;
var squareSize = 50;
var variant = getParameterByName("variant")?getParameterByName("variant"):"";
var leader;

var gameBoard = new Array();
for (var x=0; x< gridSize; x++){
  gameBoard.push(new Array());
  for (var y=0; y< gridSize; y++){
    gameBoard[x][y] = "empty";
  }
}

var players = {};

function initBoard(){
  for (var x=0; x<gridSize; x++){
     for (var y=0; y<gridSize; y++){
          var image = game.add.sprite(x * squareSize + x, y * squareSize + y, 'grid');
          image.width = squareSize;
          image.height = squareSize;
      }
  }
}


function makeNewCommando(id, color){
  var gridPosition = {
    x: Math.floor(Math.random() * gridSize),
    y: Math.floor(Math.random() * gridSize)
  }
  var commando = game.add.sprite(gridPosition.x * squareSize + squareSize/2 + gridPosition.x,
                                 gridPosition.y * squareSize + squareSize/2 + gridPosition.y ,
                                 'commando');
  commando.anchor.setTo(0.5, 0.5);
  commando.width = squareSize;
  commando.height = squareSize;
  commando.gridPosition = gridPosition;
  commando.id = id;
  gameBoard[gridPosition.x][gridPosition.y] = commando;
  if(color){
    commando.tint = "0x"+color;
    commando.color = color;
  }

  players[commando.id] = commando; //add comando to player array
};

function moveCommando(commando, x, y){
  if(commando == null){
    return;
  }

  if (x<0 || x>=gridSize || y<0 || y>=gridSize || gameBoard[x][y] == "underwear"){
    return;
  }

  if (typeof gameBoard[x][y] == "object"){
    killCommando(commando,gameBoard[x][y]);
    gameBoard[x][y] = "underwear";
    return;
  }

  commando.canMove = false;
  gameBoard[commando.gridPosition.x][commando.gridPosition.y] = "empty";
  gameBoard[x][y] = commando;

  commando.gridPosition.x = x;
  commando.gridPosition.y = y;

  var tween = game.add.tween(commando).to( {
    x: x * squareSize + squareSize/2 + x ,
    y: y * squareSize + squareSize/2 + y
  }, 60, Phaser.Easing.Cubic.Out);

  tween.onComplete.addOnce(function(){
    commando.canMove = true;
  },this)

  tween.start();
}

function killCommando(killer, commando){
  // var killsRef = new Firebase('https://goingcommando.firebaseio.com/'+variant+'/players/'+killer.id+'/kills');
  var killsRef = firebase.database().ref(variant+'/players/'+killer.id+'/kills');
  killsRef.transaction(function (current_value) {
    killCount = (current_value || 0) + 1;
    killer.kills = killCount;

      //update leader
    if (leader == null || killer.kills > leader.kills){
      leader = {color: killer.color, kills: killer.kills};
      document.querySelector(".leader").innerHTML = "Leader: " + leader.kills + " kills";
      document.querySelector(".leader").style.backgroundColor = "#"+leader.color;
    }
    return killCount;
  });

  // var commandoRef = new Firebase('https://goingcommando.firebaseio.com/'+variant+'/players/'+commando.id);
  var commandoRef = firebase.database().ref(variant+'/players/'+commando.id);

  var gridPosition = commando.gridPosition;
  var underwear = game.add.sprite(gridPosition.x * squareSize + squareSize/2 + gridPosition.x,
                                 gridPosition.y * squareSize + squareSize/2 + gridPosition.y ,
                                 'underwear');
  underwear.anchor.setTo(0.5, 0.5);
  underwear.width = squareSize;
  underwear.height = squareSize;
  underwear.tint = commando.tint;

  commandoRef.update({ isDead: true })
  commando.destroy();

};

//game setup

var game = new Phaser.Game(gridSize * squareSize + gridSize,
                           gridSize * squareSize + gridSize,
                           Phaser.AUTO, 'phaser-example', {
  preload: preload,
  create: create
});

function preload() {
  game.load.image('grid', images.grid);
  game.load.image('commando', images.commando);
  game.load.image('underwear', images.underwear);
}

function create() {
  game.stage.disableVisibilityChange = true;
  initBoard();
}

//firebase communication

// var playersRef = new Firebase('https://goingcommando.firebaseio.com/'+variant+'/players');
var playersRef = firebase.database().ref(variant+'/players');
playersRef.remove();

// var ordersRef = new Firebase('https://goingcommando.firebaseio.com/'+variant+'/orders');
var ordersRef = firebase.database().ref(variant+'/orders');
ordersRef.remove();

playersRef.on('child_added', function(snapshot) {
  var newCommando = snapshot.val();
  makeNewCommando(newCommando.id, newCommando.color);
  console.log("adding new commando");
});

ordersRef.on('child_added', function(snapshot) {
  var newOrder = snapshot.val();
  var commando = players[newOrder.id];

  switch (newOrder.direction){
    case "left":
      commando.angle = -90;
      moveCommando(commando,commando.gridPosition.x-1, commando.gridPosition.y);
      break;

    case "right":
      commando.angle = 90;
      moveCommando(commando,commando.gridPosition.x+1, commando.gridPosition.y);
      break;

    case "up":
      commando.angle = 0;
      moveCommando(commando,commando.gridPosition.x, commando.gridPosition.y-1);
      break;

    case "down":
      commando.angle = -180;
      moveCommando(commando,commando.gridPosition.x, commando.gridPosition.y+1);
      break;
  }
});

///utils

function getParameterByName(name, url) {
    if (!url) url = window.location.href;
    url = url.toLowerCase(); // This is just to avoid case sensitiveness
    name = name.replace(/[\[\]]/g, "\\$&").toLowerCase();// This is just to avoid case sensitiveness for query parameter name
    var regex = new RegExp("[?&]" + name + "(=([^&#]*)|&|#|$)"),
        results = regex.exec(url);
    if (!results) return null;
    if (!results[2]) return '';
    return decodeURIComponent(results[2].replace(/\+/g, " "));
}

var images = {
  "grid": "data:image/png;base64,",
  "commando": "data:image/png;base64,",
  underwear: "data:image/png;base64,"
}
